import React from 'react'
import {Link} from 'react-router-dom';
// import About from './About';


function Menu() {
  return (
    <>
      <h1>This is a menu</h1>
      <Link to='/about'>About</Link>
      <Link to='/contact'>Contact</Link>

    </>
  )
}

export default Menu;
